import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/HomePage.vue';
import AuthPage from '../views/AuthPage.vue';
import YahooSignIn from '../views/YahooSignIn.vue';
import YahooHome from '../views/YahooHome.vue';
import YahooCallback from '../views/YahooCallback.vue';  // New Component

const routes = [
  {
    path: '/',
    name: 'AuthPage',
    component: AuthPage
  },
  {
    path: '/home',
    name: 'Home',
    component: Home
  },
  {
    path: '/yahoo-signin',
    name: 'YahooSignIn',
    component: YahooSignIn
  },
  {
    path: '/yahoo-home',
    name: 'YahooHome',
    component: YahooHome
  },
  {
    path: '/auth/yahoo/callback',
    name: 'YahooCallback',
    component: YahooCallback
  },
  // other routes
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
